column59:
MAL ESTAR ;
VÔMITO;
ASTENIA

dose 1 de coronavc em 25/01/2021;
dose 2 aprazada para 22/02/2021;
Paciente estava viajando e não pode retornar para receber o imunobiológico em data correta;
Dose 2 administrada em 01/03/2021.

Usuário com hist´oria de doença cardiopática hioertensiva grave, AVC em 2015, Fazia uso de meticamentos contínuos: Varfarina5mg (1/2 cp de segunda a quinta e 1 cp de quinta a segunda);
Espironolactona 25 mg ( 1cp ao dia);
Sinvastatina 40 mg(1cp a noite);
Carvediol 12,5 (1cp 12/12 hs);
Realizou consulta medica no dia 06/05/2021 anterior a vacina as 7:30 na unidade de saúde devido a síncopes, mal estar, perestsia de mãos, pés e boca. Solicitado ECG.
No mesmo dia aproximadamente 6 horas após a aplicação da vacina. apresentou falta de ar, calafrios e cefaléia, com leve melhora no dia seguinte. Por volta das 19 horas do dia 07/05/2021 novamente o paciente com  falta de ar, calafrios e cefaléia, levado ao hospital teve parada cardio - respiratória e posterior óbito. NA declaração do óbito, constam as seguintes causas: 
 1 Parada cardio - respiratória;
 2 Cardiopatia Hipertensiva, AVC,
